							 dbo.tblProduct AS Prod ON Details.ProdID = Prod.ProdID LEFT OUTER JOIN
							 dbo.tblInsuree AS I ON C.InsureeID = I.InsureeID LEFT OUTER JOIN
							 dbo.tblHF AS HF ON C.HFID = HF.HfID LEFT OUTER JOIN
