	WHERE        (C.ValidityTo IS NULL) AND (Prod.ValidityTo IS NULL) AND (I.ValidityTo IS NULL) AND (HF.ValidityTo IS NULL) AND (HFD.ValidityTo IS NULL) AND (DATEDIFF(DAY, 
